const headers = {
  'Content-Type': 'application/json',
  "Access-Control-Allow-Origin": "*"
}
function Posts(url,objs)
{

  axios.post(url,objs,headers)
  .then((res)=>{console.log(res.data)})
  .catch((e)=>{console.log(e.response.data)});

}
function Login()
{





